  [],\n\t\"revision_timestamp\": \"2016-07-27T22:41:45.017179\",\n\t\"name\": \"baseline-contaminants-study-of-the-edwin-b-forsythe-national-wildlife-refuge\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The primary objective of this study was
  to develop a survey of baseline chemical residue data for sediment and sediment-associated
  organisms (e.g., forage fish and macroinvertebrates) within the Refuge. This study
  also examined potential transfer of contaminants from sediments to forage organisms
  and to higher trophic levels by estimating from the baseline data the possible contaminant
  doses available to piscivorous birds and shorebirds on the Refuge. Particular emphasis
  was placed on evaluating whether high levels of PCBs and other organochlorine compounds
  found in peregrine falcons and their eggs relate to contaminant sources on the Refuge.
  Specifically, the goals of this study were to: (1) characterize ambient concentrations
  of metals (particularly mercury), organochlorine pesticides, co-planar PCBs (specifically,
  congeners 77, 126, and 169) and organotins in sediments and forage organisms from
  all major and selected minor surface water drainage systems of the Barnegat, Brigantine,
  and Reedy Creek Divisions of the Edwin B. Forsythe NWR; (2) determine if contaminants
  are present in sediments and forage species at levels of concern to predatory fish,
  piscivorous birds, wading birds, waterfowl and other wildlife; (3) evaluate if high
  levels of PCBs, organochlorine compounds, and mercury previously found in the tissues
  and eggs of peregrine falcons nesting near the Refuge relate to contaminant sources
  located on the Refuge; and (4) identify possible contaminant sources (if any), make
  recommendations for future studies to further identify sources and impacts, and
  suggest remedial actions (if necessary) to protect Service trust resources.\",\n\t\"license_title\":
